public class WrapperStringToInt {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      String a="10";
      String b="5";
       
     int num1= Integer.parseInt(a);
     int num2= Integer.parseInt(b);
       int c=num1+num2;
       System.out.println(c);
       
	}

}
